import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardHeader from '@mui/material/CardHeader';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import StarIcon from '@mui/icons-material/StarBorder';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Link from '@mui/material/Link';
import GlobalStyles from '@mui/material/GlobalStyles';
import Container from '@mui/material/Container';
import TextField from '@mui/material/TextField';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import {useRef} from 'react';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

import {PostAsync} from '../api/http'

function Copyright(props) {
  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const tiers = [
  {
    title: 'Plan A',
    price: '2000',
    description: [
      'This is a basic life insurance plan which provides all the basic needs you have. This plan only provides insurance to TWO important diseases <Erythematous, Heart Disease> except the basic needs',
    ],
    // buttonText: 'Sign up for free',
    // buttonVariant: 'outlined',
  },
  {
    title: 'Plan B',
    subheader: 'Most popular',
    price: '5000',
    description: [
       'This is a basic life insurance plan which provides all the basic needs you have plus more severe diseases. This plan only provides insurance to Eight important diseases <Erythematous, Heart Disease> except the basic needs',
    ],
    // buttonText: 'Get started',
    // buttonVariant: 'contained',
  },
  {
    title: 'Plan C',
    price: '10000',
    description: [
      '3',
    ],
    // buttonText: 'Contact us',
    // buttonVariant: 'outlined',
  },
];

const footers = [
  {
    title: 'Company',
    description: ['Team', 'History', 'Contact us', 'Locations'],
  },
  {
    title: 'Features',
    description: [
      'Cool stuff',
      'Random feature',
      'Team feature',
      'Developer stuff',
      'Another one',
    ],
  },
  {
    title: 'Resources',
    description: ['Resource', 'Resource name', 'Another resource', 'Final resource'],
  },
  {
    title: 'Legal',
    description: ['Privacy policy', 'Terms of use'],
  },
];

function PricingContent() {
  const [open, setOpen] = React.useState(false);
  const [openComfirm, setOpenComfirm] = React.useState(false);
  const [price, setPrice] = React.useState(0);

  const handleCloseComfirm = ()  => {
    setOpenComfirm(false)
  }


  const handleClose = () => {
    setOpen(false);
  };

  const handlePay = () => {
    setOpen(false)
    setOpenComfirm(true)

  }

  const firstNameField = useRef('')
  const middleNameField = useRef('')
  const lastNameField = useRef('')
  const streetAddressLine1Field = useRef('')
  const streetAddressLine2Field = useRef('')
  const stateField = useRef('')
  const cityField = useRef('')
  const zipCodeField = useRef('')
  const phoneNumberField = useRef('')
  const emailField = useRef('')
  const monthField = useRef('')
  const dayField = useRef('')
  const yearField = useRef('')
  const heightField = useRef('')
  const weightField = useRef('')

  const [diseasesState, setDiseasesState] = React.useState({
    hbp: false,
    Cataract: false,
    hd: false,
    Cancer: false,
    Diabetes: false,
    covid: false,
    hiv: false,
    criticalIllnesses: false
  })

  const handleDiseaseChange = (event) => {
    setDiseasesState({...diseasesState, [event.target.name]: event.target.checked})
  }
  

  const [plan, setPlan] = React.useState('');

  const handleChange = (event) => {
    setPlan(event.target.value);
  };

  const handleSubmit = async (event) => {
    
    var userForm = {
      firstName: firstNameField.current.value,
      middleName: middleNameField.current.value,
      lastName: lastNameField.current.value,
      streetAddressLine1: streetAddressLine1Field.current.value,
      streetAddressLine2: streetAddressLine2Field.current.value,
      state: stateField.current.value,
      city: cityField.current.value,
      zipCode: zipCodeField.current.value,
      phoneNumber: phoneNumberField.current.value,
      email: emailField.current.value,
      month: monthField.current.value,
      day: dayField.current.value,
      year: yearField.current.value,
      height: heightField.current.value,
      weight: weightField.current.value,
      diseasesState,
      plan
    }
    console.log(userForm)
    const res = await PostAsync('/price', userForm);
    setPrice(res.data.price)
    setOpen(true)
  }
  return (
    <React.Fragment>
       <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="draggable-dialog-title"
      >
        <DialogTitle style={{ cursor: 'move' }} id="draggable-dialog-title">
          Price
        </DialogTitle>
        <DialogContent>
          <DialogContentText>
            Your insurance's price is ${price} totally.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={handleClose}>
            Cancel
          </Button>
          <Button onClick={handlePay}>Pay Now</Button>
        </DialogActions>
      </Dialog>

      <Dialog
        open={openComfirm}
        onClose={handleCloseComfirm}
        aria-labelledby="draggable-dialog-title"
      >
        <DialogTitle style={{ cursor: 'move' }} id="draggable-dialog-title">
          Payment Comfirm
        </DialogTitle>
        <DialogContent>
          <DialogContentText>
            You have pay it successfully! A comformation email has been sent to you email: {emailField.current.value}
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={handleCloseComfirm}>
            OK
          </Button>
          </DialogActions>
      </Dialog>


      <GlobalStyles styles={{ ul: { margin: 0, padding: 0, listStyle: 'none' } }} />
      <CssBaseline />
      <AppBar
        position="static"
        color="default"
        elevation={0}
        sx={{ borderBottom: (theme) => `1px solid ${theme.palette.divider}` }}
      >
        <Toolbar sx={{ flexWrap: 'wrap' }}>
          <Typography variant="h6" color="inherit" noWrap sx={{ flexGrow: 1 }}>
            Company name
          </Typography>
          <nav>
            <Link
              variant="button"
              color="text.primary"
              href="#"
              sx={{ my: 1, mx: 1.5 }}
            >
              Features
            </Link>
            <Link
              variant="button"
              color="text.primary"
              href="#"
              sx={{ my: 1, mx: 1.5 }}
            >
              Enterprise
            </Link>
            <Link
              variant="button"
              color="text.primary"
              href="#"
              sx={{ my: 1, mx: 1.5 }}
            >
              Support
            </Link>
          </nav>
          <Button href="#" variant="outlined" sx={{ my: 1, mx: 1.5 }}>
            Login
          </Button>
        </Toolbar>
      </AppBar>
      {/* Hero unit */}
      <Container disableGutters maxWidth="sm" component="main" sx={{ pt: 8, pb: 6 }}>
        <Typography
          component="h1"
          variant="h2"
          align="center"
          color="text.primary"
          gutterBottom
        >
          Pricing
        </Typography>
        <Typography variant="h5" align="center" color="text.secondary" component="p">
          Quickly build an effective pricing table for your potential customers with
          this layout. It&apos;s built with default MUI components with little
          customization.
        </Typography>
      </Container>
      {/* End hero unit */}
      <Container maxWidth="md" component="main">
        <Grid container spacing={5} alignItems="flex-end">
          {tiers.map((tier) => (
            // Enterprise card is full width at sm breakpoint
            <Grid
              item
              key={tier.title}
              xs={12}
              sm={tier.title === 'Enterprise' ? 12 : 6}
              md={4}
            >
              <Card>
                <CardHeader
                  title={tier.title}
                  subheader={tier.subheader}
                  titleTypographyProps={{ align: 'center' }}
                  action={tier.title === 'Plan B' ? <StarIcon /> : null}
                  subheaderTypographyProps={{
                    align: 'center',
                  }}
                  sx={{
                    backgroundColor: (theme) =>
                      theme.palette.mode === 'light'
                        ? theme.palette.grey[200]
                        : theme.palette.grey[700],
                  }}
                />
                <CardContent>
                  <Box
                    sx={{
                      display: 'flex',
                      justifyContent: 'center',
                      alignItems: 'baseline',
                      mb: 2,
                    }}
                  >
                    <Typography component="h2" variant="h3" color="text.primary">
                      ${tier.price}
                    </Typography>
                  </Box>
                  <ul>
                    {tier.description.map((line) => (
                      <Typography
                        component="li"
                        variant="subtitle1"
                        align="center"
                        key={line}
                      >
                        {line}
                      </Typography>
                    ))}
                  </ul>
                </CardContent>
                <CardActions>
                  <Button fullWidth variant={tier.buttonVariant}>
                    {tier.buttonText}
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
        
      </Container>

      <Container maxWidth="md" component="main" sx={{ pt: 8, pb: 6 }}>
      <Typography
          component="h1"
          variant="h2"
          align="center"
          color="text.primary"
          gutterBottom
        >
          Buy it now!
        </Typography>

      <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <p>Full Name</p>
      <div id="nameInfo">
        <TextField
          required
          id="standard-required"
          label="First Name"
          placeholder="Chen"
          variant="standard"
          inputRef={firstNameField}
        />
        <TextField
          id="standard-required"
          label="Middle Name"
          placeholder="Colin"
          variant="standard"
          inputRef={middleNameField}
        />
        <TextField
          required
          id="standard-required"
          label="Last Name"
          placeholder="Dong"
          variant="standard"
          inputRef={lastNameField}
        />
      </div>

      <p>Address</p>
      <div>
      <TextField
          required
          id="standard-required"
          label="Street Address Line 1"
          placeholder="Chen"
          variant="standard"
          inputRef={streetAddressLine1Field}
        />
      </div>

      <div>
      <TextField
          id="standard-required"
          label="Street Address Line 2"
          placeholder="Chen"
          variant="standard"
          inputRef={streetAddressLine2Field}
        />
      </div>
        <div>
        <TextField
          required
          id="standard-required"
          label="Sate/Province"
          placeholder="New York"
          variant="standard"
          inputRef={stateField}
        />
      <TextField
          required
          id="standard-required"
          label="city"
          placeholder="New York"
          variant="standard"
          inputRef={cityField}
        />
        </div>
        <div>
        <TextField
          required
          id="standard-required"
          label="Postal/Zip Code"
          placeholder="92092"
          variant="standard"
          inputRef={zipCodeField}
        />
        </div>

        <p>Phone Number</p>
        <div>
        <TextField
          required
          id="standard-required"
          label="Phone Number"
          placeholder="xxxxxxxxxx"
          variant="standard"
          inputRef={phoneNumberField}
        />
        </div>



        <p>Email</p>
        <div>
        <TextField
          required
          id="standard-required"
          label="Email"
          placeholder="xxxxxxx@xxx.xxx"
          variant="standard"
          inputRef={emailField}
        />
        </div>

        <p>Birth Date</p>
        <div id="birthInfo">
        <TextField
          required
          id="standard-required"
          label="Month"
          placeholder="01"
          variant="standard"
          inputRef={monthField}
        />
        <TextField
          required
          id="standard-required"
          label="Day"
          placeholder="01"
          variant="standard"
          inputRef={dayField}
        />
        <TextField
          required
          id="standard-required"
          label="Year"
          placeholder="2000"
          variant="standard"
          inputRef={yearField}
        />
      </div>

        <p>Height</p>
        <div>
        <TextField
          required
          id="standard-required"
          label="Height"
          placeholder="6'1''"
          variant="standard"
          inputRef={heightField}
        />
        </div>

        <p>Weight</p>
        <div>
        <TextField
          required
          id="standard-required"
          label="Weight"
          placeholder="110 lbs"
          variant="standard"
          inputRef={weightField}
        />
        </div>

        <p>Do You Have Any of the Following Diseases or Perform Any of the Actions?</p>
        <FormGroup>
          <FormControlLabel control={<Checkbox name='hbp' checked={diseasesState.hbp} onChange={handleDiseaseChange} />} label="High Blood Pressure" />
          <FormControlLabel control={<Checkbox name='Cataract' checked={diseasesState.Cataract} onChange={handleDiseaseChange}/>} label="Cataract" />
          <FormControlLabel control={<Checkbox name='hd' checked={diseasesState.hd} onChange={handleDiseaseChange}/>} label="Heart Disease" />
          <FormControlLabel control={<Checkbox name='Cancer' checked={diseasesState.Cancer} onChange={handleDiseaseChange}/>} label="Cancer" />
          <FormControlLabel control={<Checkbox name='Diabetes' checked={diseasesState.Diabetes} onChange={handleDiseaseChange}/>} label="Diabetes" />
          <FormControlLabel control={<Checkbox name='covid' checked={diseasesState.covid} onChange={handleDiseaseChange}/>} label="COVID-19" />
          <FormControlLabel control={<Checkbox name='hiv' checked={diseasesState.hiv} onChange={handleDiseaseChange}/>} label="HIV AIDS" />
          <FormControlLabel control={<Checkbox name='criticalIllnesses' checked={diseasesState.criticalIllnesses} onChange={handleDiseaseChange}/>} label="Critical Illnesses" />
        </FormGroup>

        <p>Which Life Plan?</p>
        <FormControl fullWidth>
          <InputLabel id="demo-simple-select-label">Plan</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={plan}
            label="Plan"
            onChange={handleChange}
          >
            <MenuItem value={0}>Plan A</MenuItem>
            <MenuItem value={1}>Plan B</MenuItem>
            <MenuItem value={2}>Plan C</MenuItem>
          </Select>
        </FormControl>
    </Box>
      </Container>

      <Container maxWidth="md" component="main" sx={{ pt: 8, pb: 6 }}>
        <Button variant="contained" onClick={handleSubmit}>Submit</Button>
      </Container>

      {/* Footer */}
      <Container
        maxWidth="md"
        component="footer"
        sx={{
          borderTop: (theme) => `1px solid ${theme.palette.divider}`,
          mt: 8,
          py: [3, 6],
        }}
      >
        <Grid container spacing={4} justifyContent="space-evenly">
          {footers.map((footer) => (
            <Grid item xs={6} sm={3} key={footer.title}>
              <Typography variant="h6" color="text.primary" gutterBottom>
                {footer.title}
              </Typography>
              <ul>
                {footer.description.map((item) => (
                  <li key={item}>
                    <Link href="#" variant="subtitle1" color="text.secondary">
                      {item}
                    </Link>
                  </li>
                ))}
              </ul>
            </Grid>
          ))}
        </Grid>
        <Copyright sx={{ mt: 5 }} />
      </Container>
      {/* End footer */}
    </React.Fragment>
  );
}

export default function Pricing() {
  return <PricingContent />;
